import './style.css';
import { ReactComponent as Account } from '../../svg/account.svg';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="app-name">Price Tracker</div>
      <a href="/me" className="account-link">
        <Account />
      </a>
    </div>
  );
};

export default Navbar;
